content:
남새..내가 중학교때 모습이랑 너무 닮아서 감정이입쩔구여ㅠ
주리가 남새 왕따일지도 모른다는 말에 아무말 없었던게 주리도 혼혈이고 하다보니 과거에 따돌림 당했던 것 같은데 외모가 예뻐서 필요할 때만 찾는 은따였던것 같아여ㅠ 그 가해자들과 관련이 있었건 저 남주였는데 주리 남사친 쟤는 그 사실 알고나서 주리를 과잉보호하게 된 것 같고 남새랑 남주랑 친해보이는 모습이 한통속이라고 생각해서 적대시하는.. 아 저 단발머리가 남새 몰아갈 것 같다는;_;
하..진짜 그렇게 한다면 질투였든 다른 과거가 있었든 단발 니년은 절대 용서하지 않을것이야

이번 화 간질간질하다.. 시작부터 자기가 묶은게 났다는 거 보니까 머리도 호현이가 다시 땋아줬고
나는 사각관계로 안 보고 남새랑 호현이가 꽃 주고 받았었고 그런 거 알아서 주리가 둘이 같이 보러오라 한 걸로 이해했는데;
그리고 김우도 남새한테 좀더 부드럽게 변해서 다행이고.. ㅇㅇ

김우야 너 친구 없닝..?
왜 주리만 계속 기다리는데...;; 
주리는 너 말고 다른 친구와 지내고 싶은데 니가 왜그래..

세명은 원래 친구였고 주리가 호현이좋아하고 그러니까  호현,주리,우 사이에 뭔일있었을듯,,,주리엄마도 알고 저러시는듯함 
그래서 호현이도 김우때문에 주리피했던거고 그래서 주리도 예전화보면 또 나때문이라고했나?암튼그런거같고...호현이가 남새입장이였을듯
김우는 주리옆에 누구 두는걸 싫어하고 주리가 자기만 봐주고 좋아하면 되는입장이니까... 그래도 미는건 싸이코인듯 ;;제정신은아냐;;

주리 : 권호현이랑 뭐야?
남새 : &#x27;나....호현이 좋아하나봐...&#x27;
말해야지....남새야~~이러다....ㅠㅜ

쿠웅&gt;&lt; 
남주 여주 홧팅&gt;&lt;
손영균 누구냥
